import React from 'react';

const Sidebar = () => {
  return (
    // Create sidebar menu with react, maybe not with semantic ui
    // Toggle the content using router
    <div>
      <div className="ui inverted vertical menu sidebar">
        <a class="active item">Home</a>
        <a class="item">Movies</a>
        <a class="item">TV Shows</a>
      </div>
      <div className="pusher"></div>
    </div>
  );
};

export default Sidebar;
